//libraries
import React from 'react'

//components
import Navigation from '';
import HeroSection from './HeroSection';
import ShopSection from './ShopSection';
import AboutSection from '../components/home/About';
import Footer from './Footer';

const Home = () => {
  return (
    <div className="App">
      <Navigation />
      <HeroSection />
      <ShopSection />
      <AboutSection />
      <Footer />
    </div>
  );
}

export default Home
